const renderSection = (title, items, navigate) => (
  <div className="mb-10">
    <h2 className="text-2xl font-bold text-center text-pink-700 mb-6">{title}</h2>
    <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-6">
      {items.map((item) => (
        <div
          key={item.id}
          className="bg-white shadow-md rounded-lg p-4 flex flex-col items-center cursor-pointer"
          onClick={() => navigate(`/women/${item.id}`)}
        >
          <img
            src={item.image}
            alt={item.name}
            className="w-full h-40 object-cover rounded mb-2"
          />
          <h3 className="text-lg font-semibold">{item.name}</h3>
          <p className="text-gray-600 mb-2">{item.price}</p>
          <button className="bg-pink-600 text-white px-4 py-1 rounded hover:bg-pink-700">
            View Details
          </button>
        </div>
      ))}
    </div>
  </div>
);

